import React, { useState } from 'react';
import './Sidebar.css';

const Sidebar = ({ onFilterChange, onSearch }) => {
    const [searchQuery, setSearchQuery] = useState('');
    const [expandedSection, setExpandedSection] = useState(null);

    // 🎯 Función para mostrar/ocultar la descripción
    const toggleSection = (section) => {
        setExpandedSection(expandedSection === section ? null : section);
    };

    return (
        <div className="sidebar">
            {/* 🔍 Sección de búsqueda */}
            <div className="search-section">
                <input
                    type="text"
                    placeholder="Buscar instrumento..."
                    className="search-input"
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                />
                <button
                    className="andean-button"
                    onClick={() => onSearch(searchQuery)}
                >
                    Buscar
                </button>
            </div>

            {/* 🎼 Filtrar por tipo */}
            <div className="filters-section">
                <h3>Filtrar por tipo:</h3>
                <select onChange={(e) => onFilterChange(e.target.value)}>
                    <option value="all">Todos</option>
                    <option value="viento">Viento</option>
                    <option value="cuerda">Cuerda</option>
                    <option value="percusion">Percusión</option>
                </select>
            </div>

            {/* 🤖 Sección de Técnicas de ML con expansión */}
            <div className="ml-techniques-section">
                <h3>Técnicas de ML</h3>

                {/* 📌 Clasificación */}
                <button className="andean-button" onClick={() => toggleSection("clasificacion")}>
                    Clasificación
                </button>
                {expandedSection === "clasificacion" && (
                    <div className="expanded-section">
                        <img src="classification-diagram.png" alt="Proceso de Clasificación" className="ml-image" />
                        <p>🔎 <strong>Clasificación:</strong> Un algoritmo analiza el audio y determina a qué categoría pertenece el instrumento.</p>
                        <ul>
                            <li>📌 Se extraen características acústicas como espectrogramas.</li>
                            <li>📊 Se aplican modelos de Machine Learning como Redes Neuronales.</li>
                            <li>🎼 El sistema decide si el instrumento es de viento, cuerda o percusión.</li>
                        </ul>
                    </div>
                )}

                {/* 🔍 Identificación */}
                <button className="andean-button" onClick={() => toggleSection("identificacion")}>
                    Identificación
                </button>
                {expandedSection === "identificacion" && (
                    <div className="expanded-section">
                        <img src="identification-process3.jpg" alt="Proceso de Identificación" className="ml-image" />
                        <p>🎼 <strong>Identificación:</strong> Se detecta la presencia de un instrumento específico en una grabación de audio.</p>
                        <ul>
                            <li>📡 Se analiza la señal de audio en tiempo real.</li>
                            <li>🧠 Se compara con una base de datos de sonidos de referencia.</li>
                            <li>🎻 Se determina si el instrumento es una quena, charango, bombo, etc.</li>
                        </ul>
                    </div>
                )}
            </div>

            {/* 📌 Explicación de los Modelos de Machine Learning */}
            <div className="ml-explanation">
                <h3>🤖 Modelos de Machine Learning</h3>

                <button className="andean-button" onClick={() => toggleSection("cnn")}>📡 Redes Neuronales Convolucionales (CNN)</button>
                {expandedSection === "cnn" && (
                    <div className="expanded-section">
                        <p>Las CNN procesan imágenes de espectrogramas para identificar patrones acústicos.</p>
                        <img src="/images/cnn_diagrama.png" alt="CNN para clasificación de audio" />
                    </div>
                )}

                <button className="andean-button" onClick={() => toggleSection("svm")}>📈 Máquina de Vectores de Soporte (SVM)</button>
                {expandedSection === "svm" && (
                    <div className="expanded-section">
                        <p>Las SVM encuentran una frontera óptima entre distintas clases de instrumentos musicales.</p>
                        <img src="/images/svm_diagrama.png" alt="SVM en clasificación" />
                    </div>
                )}

                <button className="andean-button" onClick={() => toggleSection("multiclase")}>🎭 Clasificación Multiclase</button>
                {expandedSection === "multiclase" && (
                    <div className="expanded-section">
                        <p>El modelo predice la clase más probable del instrumento musical entre múltiples categorías.</p>
                        <img src="/images/multiclase_diagrama.png" alt="Clasificación multiclase" />
                    </div>
                )}
            </div>
        </div>
    );
};

export default Sidebar;
